                 "давай щас возьмем и выебим твою мать тебе ведь тоже надоела эта шалава она уже не понимает что творит а место того что одуматься она как всегда забивает свои мысли хуями как ты ее терпишь. ",
                 "Не как не могу понять зачем твоя мама стала шлюхой ведь у нее был потенциал выучиться на хорошую актрису или повара но местоэтого она теперь глотает на теплотрасе у бомжей хуи ну я в шоке. ",
                 "Не скрывай подпольный бизнес своей мтаери ведь ты сам понимаешь что твоей мамаше не получиться долго скрывать ее ведь она спалилась на томчто когда я спрсоил сколько времени она начала отсасывать мне. ",
                 "Ну же давай я щас твою мать шамарну может она наконецто поумнеет или думаешь так же будет сосать хуй да ты прав она ведь не может изменять свои принципам и ей будет тяжело перстать сосать нам. ",
                 "Твоя мать проститутка мне щас за сигарету отдалась из за чего я начал пиздить ее ногами с кентами дешевая шлюха эта бялдина даже после избения предлагала посасать но мы короче ее запинали но сосала она норм. ",
                 "Твоя мать сосет за идею когда я ее спросил какая же все таки у нее идея она овтечала что даже не в курсе эта пиздаболка просто прдумала какие то мотивации для сосание но на деле она шлюха ебанная. ",
                 "Для тебя подкинуть свою мать нам под хуи то же самое что в мгазин сходить ты тоже поудмай твоя мать шалава и так устала от поступющих в нее хуев а ты продолжаешь ну все равно спасибо ехидно мы ее в очко ебем. ",
                 "Мы сегодня с твоей мамой прогуливались пришлось надеть ей намордник ведь я сильно рисковал проходя по многочисленными площадями она могла в любой момент сорвать и начать сосать хуй так что в целях безопаснти перед выходом я ей дал в рот. ",
                 "Cегодня твоя мать решила поставить на кон всё и сыграть с нами в рускую рулекту естественно когда она поднесла пистолет к веску побоялась стрелять ну мы просто так этого не оставили и ебали за такое твою мать до утра не ну скажи тупая шлюха. ",
                 "Не зря мы твою мать столько лет дресировали на команду сосать когда мы ходим по улицам и кричим сосать она подбегает к левому пацану и начинает стягивать с него штаны и драить свой рот твоей залупой твоя мать охуенная псина. ",
                 "Говорил с твоей матерью о её образе жизни и знаешь что она ответила что ей все нравиться и менять она ничего не хочет не ну блядовка ебанная как она жить то будет я за такое ей челюсть хуём пробил ты же не против вафлежуй ебанный. ",
                 "Поступил приказ нейтрализовать твою мать в целом мы уже поняли что лишимся самой лучшой шкуры на районе но делать было нечего мы взяли оружие и пошли но когда мы вломились к ней в дом ее уже ебали 20 человек мы не могли прервать процес. ",
                 "Когда я занимался некромантией я попытался воскресить самую лучшую проститутку всех времен и знаешь получилось воскресил твою мать так место того чтобы поздороваться эта шаболда начала моим хуем свои десны палировать. ",
                 "Вечером твоя мать собирает всех своих любовников у себя в доме и расказывает как у неё прошел день но знаешь нехуя интересного она так за всю жизнь не расказала но зато мы ебём её прям во время расказа и это весело. ",
                 "Ты думаешь почему твоя мать не наедаеться обычной едой это смешно ее не когда не интересовала еда она любит жрать тоннами нашу сперму и от этого ей становиться легче как она говорит все болезни как рукой снимает. ",
                 "Первый раз я познакомился с твоей матерью совершенно случайно просто какая то девушка подбежала и начала мне сосать но на этом все не кончилось она попросил разорвать ей анальник веселая встреча я думал норм ",
                 "По утрам твоя мать бегает в соседню деревню чтобы заправиться спермаком и знаешь у неё это не всегда получаеться так мужики в деревнях заебались твоей мамки проститутки уже на клык кидать и гонят её считая ведьмой. ",
                 "Твоя мать до такой степени тупая что уже не отличает хуи и ветки как то раз встретили эту блядину когда она обсасывала ветку охуешь думюа зря мы били каждый день залупами по голове но все таки неплохо она сосет. ",
                 "Твоя мать словила хайп на том что первая в СССР ходила и давала в очко тогда все пряталиь и секса вовсе не было а тут твоя мать прямо на площадях говорила что она проститутка и чтобы её наконецто кто то выебал. ",
                 "Твоя мать раньше любила курить но решила бросить и попросила нас помочь так что когда она сильно хочет курить мы пихаем залпом ей хуи в рот и вроде потом она задыхаясь блогадарит нас за помощь нам не сложно. ",
                 "Первый кто отважился посмотреть на твою мать как на человека мой кент он поверил ей но когда я прямо на его глазах начал пялить ее в рот он понял что это обосанная хуйня не достойнно не кого уважения и тоже залупой ей рот брил. ",
                 "Они говорили твоя мать играет с людьми но на деле все по другому мы играли с её ртом почти каждый день и знаешь за это время мы поняли что твоя мать бесползеная шалава которая кроме того чтобы отсосать больше вобщем то нечего и не умеет. ",
                 "Твоя мать эгоистка по отношению к твоему бати ведь всем нам она сосёт а бати даёт только мохнатку полизать мы решили что это не правильно и отбили ей шамаров за это теперь она сосет твоему бати как и нам но твой батя тоже пару раз нам сосал но это уже другая история. ",
                 "Во время войны твоя мать только нашими залупами и спасалась не понимаю зачем но терла наши хуи салом и все слизывала знаешь вроде она наедалась так и шли года а твоя мать даже после тяжелого время так и сосет нам как собака павлова внатуре в привычку вошло. ",
                 "Даже Пифагор создал теорему на счет твоей матери если твоя мать нам не пососет с ней по любому что нибудь случиться и теперь она этого боиться и отсасывает нам каждый день и все с ней хорошо и все рады вобщем. ",
                 "Вкачивая твою мать информацией что она шлюха мы вовсе не пытаемся её оскорбить мы говорим лишь по фактам разве бы ты не хотел отпердолить такую гниль как она хотел бы конечно но ты ещё веришь что она твоя мама. ",
                 "По приросту сил в наших залупах мы бежим к твоей матери и она с порога начинает торговать своим телом перед всеми нами и знаешь мы не чего ей не платим она нам в долг заисывает если так посчитать мы с твоей матерью не расплатимся но кто сказал что мы отдадим. ",
                 "Когда происходит сходяк бандитов твоя мать всегда там а знаешь зачем потому что бандиты во время встреч напряжены обсуждая свои дела и твоя мать раслабляет их отсосом не разу ещё где была твоя мать не было перестрелки. ",
                 "Твоя мать ебанное животное и знаешь я не желею что тогда насал ей на еблет ведь эта парашница решила сказать что теперь не кому из нас сосать не будет у неё новая жизнь и все дела не ну это блядовка охуела согласись. ",
                 "Постепенно твоя мать превращалась в нормальную женщину но в один момент опять сорвалась и начала давать свою пизду на разрыв всему району ты внатуре хочешь её сейчас выставить как культурную женщину хотя сам видел что она наши хуи в свой рот пропихивала. ",
                 "Когда ты первый раз пришел к нам и расказывал нам про свою мать и что у неё отличный проект о балготворительности мы даже поверили но потом поняли суть преокта что она ходит к бедным и сосет им совршенно бесплатно мы выдвинули этот проект на расмотрения. ",
                 "Пиздато когда твоя мать прибегать пососать хуи за просто так признаюсь иногда я сижу у окна и жду когда твоя мать рпибежит шучу конечно она и так каждый день у порога когда я ей хуём гланды поправлю а ты думал её вобще кто то ждёт. ",
                 "Твоя мать была гимнасткой и стремилась к вершинам покорения спортам но потом она поняла что ей нахуй это не надо и решила использывать свою растяжку для нас спасибо большое ей за это мы навсегда запомним её доброту и за это подкинем ей на хлеб. ",
                 "Паралельна твоя мать ещё успевала работать в банке и вроде неплохо зарабатывала но когда мы залетели на движ с пацанами начали выносить бабки твоя мать попала под наш прицел но она была не против но на прощания попросила пососать ведь она знала что больше не увидит нас. ",
                 "Растояние не влияет на любовь людей к друг друга но твоя мать не исключения пока твой батя в командировках она прибегает ко мне и глотает наши хуины ну что за бред а бати пишет что скора у них все случиться бля я бы этой крысе глотку свернул но сосет норм. ",
                 "Рафаэль на счет твоей матери написал картину твоя мать вместе с хуем на фоне бегает по полям ведь так и было она еще до нашей эры отсасывала динозаврам а я то думал почему в её рот по случайности захеал самосвал ты тоже охуел да. ",
                 "Когда я устраивал пир во время чумы со своими друзьями простые смертные тролли погибали а мы заливались вином и тут прибежала твоя мать и попросилась к нам за отсос она отсосала конечно всему замку но ты же понимаешь что мы её не пустили. ",
                 "Не бери пример со своей мамы ведь вобщем то чему она может тебя научить пососать за билет в будущее нет малой стремись вверх а мы пока посидим и послушаем раскзаы твоей мамки что она нас любит и только из за этого сосет всем нам. ",
                 "Идёт набор в ряды молодых бойцов для отправки их на войну в чечню но блять нахуй туда поперлась твоя мать ее план когда наши будут отбивать атаки боевиком она будет их отвлекать отсосом тогда боевики раздобряться и наши их смогут вынести. ",
                 "Не чего не поделаешь твоя мать опять решила набухаться как свинота и сейчас танцует на барной стойке я попытался тормознуть её но не чего не вышло эта шалошовка опять полезла на стол я её пристрелил но не волнуйся пососать захочет встанет. ",
                 "Твоя мама любит печь пироги да и ваша семья их вроде как любит но знаешь какой секретный ингредиент в этих пирогах наша с пацанами сперма она заправляет ей пирог и вы свиньи ебанные пожираете наши отходы плевок в ебало тебе чухан. ",
                 "Когда твоя мать позвала переустоновить винду я подумал что опять эта тупая пизда что то сломала пришел а там твоя голая мамаша стоит но я как ебанул ей леща и туханул с ноги я вобще в фалаут хотел поиграть а не эту цыганку обрабатывать. ",
                 "По слухам твоя мать сосала Гитлеру как она говорила ей понравилась его идея о захвате мира но её обломали и после этого она уже сосала Сталину и тут она опять обломалась и пришла ко мне чувствую себя Генералисимусом. ",
                 "Твою мамашу не заботит даже то что ты сидишь дома голодный животное ебанное она прибегает к нам и в голове у нее мысль сосать сосать но мы ей врпавили мозги и передали ей небольшое количество еды в банке там если что наша сперма похавай братец. ",
                 "Когда я подрался из за твоей мамы это было самая глупая ошибка в моей жизни ведь потом пацаны мне объеснили кто она и чем живет но мы посмеялись и дружно дали ей на рота бля а так все хорошо начиналось. ",
                 "Когда твоя мать нарушил правила доожного движения менты ей хотели выписать штраф но эта путана место того чтобы отдать какие то 1000руб. решила что будет сосать всему участку до конца своей жизни и даже не прединтовать на отказ. ",
                 "Твоя мать знаменита в сфере протитуции если речь заходит о том на кого потратить 500руб. твоя мать мигом здесь и знаешь что я верю в то что она когда нибудь повысит ставки и уже не будет хуярить своим ртом за копейки. ",
                 "Ты так завелся на счёт того что я сказал что твоя маманя шлюха ты не принимай близко к сердцу ведь я не хотел сильно подпортить ей рипутацию но ты сам подумай будет ли нормальная женщина за тюремный паёк у всего района сосать. ",
                 "Твою мать называли певицей но все именилось хотя не скажу что сильно теперь место того чтобы петь в микрофон она поёт в наши залупы и не комплексует по этому поводу неужели из певицы получилась богиня проституции. ",
                 "Не может быть чтобы твою мать ебали все ты подумал в один день и решил сам это проверить когда ты проследил за ней не успел повернуться как её драли под 10 человек не прошло и минуты ты разочеровался в своей матери. ",
                 "Позвони мне когда захочешь отдать свою мать как подарок потому что мы тут подумали и решили что на ней можно крутить нехуёвые бабки ведь пока её очко дербанит бесплатно а мы поставим ценик не волнуйся по бабкам договоримся. ",
                 "Когда ты высираешься что твоя мать спит дома и мы её точно не ебём ты ошибаешься твоей матери достаточно свистануть и она тут же здесь мы не будем говорить чем твоя мать промышляет после этого ведь ты сам знаешь правду. ",
                 "Не грусти и твоя мать когда нибудь станет королевой но пока она только растоптаная шалава которую может пердолить каждый школьник но это все временно скоро она уйдёт от сюда когда заработает себе на платья но мне кажеться она нас наебала нельзя на платья работать 30 лет. ",
                 "Приведу пример вот смотри у каждого мамы сидят дома и готовят ужин твоя мать просто бегает и просит чтобы её хоть как то отпиздили залупами но она тоже не права жалко марать свой половой орган об эту подстилку согласись. ",
                 "Твоя мать приходила на поле чудес но место того чтобы крутить барабан раскручивали её и не поверишь сектор приз на барбане твоя мать досталась колывану из Воронежа неожиданно но в какой то мере приятно что мы её больше не увидим. ",
                 "Не задирай нос ведь ты помнишь когда мы драли твою мать перед твоими глазами а ты сидел зажавшись в угол и даже нечего нам не мог ответить ведь сам понимал что мы её не насиловали а она сама нас попросила научить тебя жизни. ",
                 "Когда ты делал уроки классе в 4 твоя мать уже хулиганила со своим аналом ты думаешь кто смог сесть на 45л. бутыль до основвания и попал в книгу рекордов гинесов конечно это была твоя мать а ты надеялся что хоть в этот раз не она да. ",
                 "Твоя мать отсосала за обрыганный леденец в вагоне метро понимаешь там сидели люди и они наверно не очень хотели смотреть на эту залуподранку но выбора не было ведь твоя мать насойчива и хотела чтобы её видел каждый. ",
                 "Пришел к твоей матери спросить как жизнь но она даже не выслушав меня попросила отпороть её на крвати но как можно ебать твою мать и одному конечно же я позвал друзей и вот тогда мы уже дружно вздернули её. ",
                 "Не ведись на раводки твоей матери типо она не шлюха это просто жизнь такая да нет ей в кайф отсасывать бомжам и всем подряд не судите ее строго просто она прирожденная проститутка не чего более я думаю снова ебануть ей смачного леща ",
                 "Нельзя переходить дорогу твоей матери ведь если ты попробуешь назвать её шлюхой она начнет доказывать обратное и все как всегда закончиться поревом а потом она скажет прости я не хотела просто привыкла что когда на меня кричат надо дать в жопу. ",
                 "Стоял спокойнно курил и тут подбегает твоя мать я даже не узнал ее сразу говорю что вам надо и она отвечает за сигарету отсосу и тогда я понял что это твоя мать и просто заставил сделать её отсос еще блять я этой шалаве сигареты не давал. ",
                 "Сбрался огромный стол и за этим столом мы решили как будем распростронять твою мать в массы и тогда нам пришла идея пустить её в какой нибудь бомжатник ведь как мы считаем ей там самое место да и тем более опыта там набереться. ",
                 "Не оставляй на завтра то что можешь сделать сегодня так мне сказала твоя мать после чего пришлось её выебать ведь как мне кажеться такая шлюха как она точно плохо не посоветует лишь бы спидом не зазазиться слава богу есть резинки которые она взяла у твоего бати. ",
                 "В реальной жизни твоя мать не такая как в интернете т.е в инете она пишет что ищет серьёзные отношение и так далее но в жизни всё совсем по другому ведь она в жизни всё что делает это сосёт нам за своё место под солнцем. ",
